import React from 'react';
import { Link } from 'react-router-dom';

import style from './sideNav.module.css';
import Home from '../../Home/home';

const SideNavItems = () => {
    return(
        <div className={style.option}>
            <Link to="/">
                <FontAwesome name="home"/>
                Home
            </Link>
        </div>
    )
}

export default SideNavItems;
